  `paypal_ipn_url` varchar(250) DEFAULT NULL
) ENGINE=MyISAM DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: system_events
#

DROP TABLE IF EXISTS system_events;

