  `messages_date` datetime NOT NULL,
  `messages_text` text NOT NULL,
  `messages_by_id` int(11) NOT NULL,
  PRIMARY KEY (`messages_id`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;



