  `messages_replies_date` datetime NOT NULL,
  `messages_replies_text` text NOT NULL,
  `messages_replies_by_id` int(11) NOT NULL,
  PRIMARY KEY (`messages_replies_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

