 The section similar to Vanguard website with &ldquo;Need to schedule an appointment&rdquo;, &ldquo;Contact us today&rdquo; button</p>\n\n<p>2. The section similar to Specimen website with &ldquo;How can we help you?&rdquo; and the 4 columns &ldquo;I hate my smile, missing tooth, straighter teeth, family dentist&rdquo;</p>\n\n<p>3. Body content like Lisa Sidall website with &ldquo;Welcome to Lisa Siddall&rdquo;/testimonial below, with sidebar that contains contact form, a banner (like free consult for new patient, click here&gt;&gt;), why choose us</p>\n\n<p>4. Meet Dr. Michael Vo short section, like Lisa Sidall</p>\n\n<p>5. Footer section with menu, google maps, business information, social media buttons, and hours of operations</p>\n\n<p>&nbsp;</p>\n\n<p>Inner pages: We like the h1 title followed by horizontal line, as well as same side bar content/footer from home page</p>\n\n<p>&nbsp;</p>\n\n<p>Special instructions: built on WordPress, (if possible) home page content are editable through widgets)&nbsp;</p>\n', NULL, 0, 'in progress', NULL, 'sefewgf', 'http://www.brontedentist.com', 'erg', '0', '0', NULL, NULL, NULL);
