INSERT INTO quotationforms (`quotationforms_id`, `quotationforms_title`, `quotationforms_code`, `quotationforms_date_created`, `quotationforms_status`, `quotations_created_by_id`) VALUES (1, 'Web Design Quotation Form', '{\"fields\":[{\"label\":\"Do you have your existing site for redesign or you need new website\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c35\"},{\"label\":\"Can you please describe your business\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c10\"},{\"label\":\"Who are your competitors\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c14\"},{\"label\":\"Do you have special features in mind\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c18\"},{\"label\":\" Is the content ready for your web site\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c40\"},{\"label\":\"Are there any example websites that you like\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c30\"},{\"label\":\"What is your approximate budget for this project\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c26\"},{\"label\":\"What is your deadline for finishing the site\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c44\"}]}', '2014-12-11 08:34:00', 'enabled', 1);
INSERT INTO quotationforms (`quotationforms_id`, `quotationforms_title`, `quotationforms_code`, `quotationforms_date_created`, `quotationforms_status`, `quotations_created_by_id`) VALUES (2, 'LOCAL SEO QUESTIONNAIRE', '{\"fields\":[{\"label\":\"Business Name:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c2\"},{\"label\":\"Business Street Address:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c6\"},{\"label\":\"State/Province:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c12\"},{\"label\":\"Postal/Zip Code:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c18\"},{\"label\":\"Country:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c24\"},{\"label\":\"Official Contact Person:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c30\"},{\"label\":\"Business Telephone Number:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c36\"},{\"label\":\"Year Founded:\",\"field_type\":\"text\",\"required\":false,\"field_options\":{\"size\":\"small\"},\"cid\":\"c48\"},{\"label\":\"Business Contact Email:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(Please put the email address your business uses info@business.com for all business-related correspondences.)\"},\"cid\":\"c42\"},{\"label\":\"Contact Name for Citations:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(This will be used to create accounts on various business directories such as Yelp, YP, etc. It could be owner\'s name, a manager, or an alias.)\"},\"cid\":\"c53\"},{\"label\":\"Citations Gmail and Password:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(Please provide us with a new GMAIL account businessname2015@gmail.com that we can use to register/verify your business in various business directories. This GMAIL is going to receive a high volume of spam.)\\n\"},\"cid\":\"c77\"},{\"label\":\"Hours of Operation: \",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(Please breakdown week day hours Mon, Tues. Wed, Thrus, Fri, Sat, Sun and if they vary throughout the week.) \"},\"cid\":\"c35\"},{\"label\":\"Business Listing Category\'s:\",\"field_type\":\"paragraph\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"(THIS IS OPTIONAL. If you choose to give this information then please provide us with as many as 5 business categories your business falls under  to ensure listing on all business directories. Ex: Hotel, Luxury Hotel, Boutique Hotel, etc. One per line.)\"},\"cid\":\"c39\"},{\"label\":\"Targeted Areas:\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(Please list 5 - areas /  neighbourhoods / main streets / cross streets) \"},\"cid\":\"c87\"},{\"label\":\"Business Description:\",\"field_type\":\"paragraph\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"(THIS IS OPTIONAL. If you choose to provide this information then please provide 2 or 3 short punchy paragraphs that best describes your business and why potential customers/clients should choose you over your competition. Try to start the first paragraph with a main keyword. Most clients usually take an existing description from their website, Facebook or map listing about).\"},\"cid\":\"c43\"},{\"label\":\"Name some PRODUCTS/SERVICES you sell/offer:\",\"field_type\":\"paragraph\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"(THIS IS OPTIONAL. If you choose to give this information then please provide us with as many as 10 of your most popular or best selling or expensive products/services. One per line.)\"},\"cid\":\"c48\"},{\"label\":\"Known Competitors:\",\"field_type\":\"paragraph\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"THIS IS OPTIONAL. If you choose to give this information then please provide us up to 5 competitors in the area, who you want to compete with or are on page one of search results for the keywords you are targeting. One per line.)\"},\"cid\":\"c54\"},{\"label\":\"Website URL:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"\"},\"cid\":\"c59\"},{\"label\":\"Google+ URL:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(Please make sure it is the Google+ associated to your Google Map Listing).\"},\"cid\":\"c54\"},{\"label\":\"YouTube Channel Page Link:\",\"field_type\":\"text\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"(Does the channel page have the proper Google + link attached to the page.  If not this will need to be completed by us).\"},\"cid\":\"c59\"},{\"label\":\"Main Video Page Link:\",\"field_type\":\"text\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"(Does the video page have the proper Google + link attached to the page.  Is the about description completed with keywords targeted.  If not this will need to be completed by us).\"},\"cid\":\"c64\"},{\"label\":\"Link to Photos:\",\"field_type\":\"paragraph\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"(Please provide links to your up to date photos of the business, products/services.  It may be Facebook, Pinterest, Google +, Flickr or some other site.  If not 5 to 10 photos are required, sent in an email or shared on dropbox).\"},\"cid\":\"c92\"},{\"label\":\"Facebook Page Link:\",\"field_type\":\"text\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"\"},\"cid\":\"c69\"},{\"label\":\"Twitter Page Link:\",\"field_type\":\"text\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"\"},\"cid\":\"c79\"},{\"label\":\"Pinterest Page Link:\",\"field_type\":\"text\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"\"},\"cid\":\"c85\"},{\"label\":\"Other sharing sites that your business uses:\",\"field_type\":\"paragraph\",\"required\":false,\"field_options\":{\"size\":\"small\"},\"cid\":\"c58\"},{\"label\":\"Keyword phrases or sentence:\",\"field_type\":\"paragraph\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"(Write as many as 10 sentences with 3 to 5 keywords per sentence or phrase that you wish to target)\\nExamples:\\n1 - Luxury Hotels Downtown Montreal\\n2 - Best Mexican Restaurant in Montreal\\n3 - Best Hair Salons Downtown Montreal\\n4 - Vintage Wedding Dress Boutiques\\n5 - Best Restaurant on St-Denis\\n\\n=====================\\n\\nNOTE: Please add this email addresses to your Google+ Local Page as a MANAGER if you need us to fully optimize your map listing.\\n\\nteambuzzooka@gmail.com\\n\\nIf you need assistance in doing this then kindly give us a call or email us to schedule a short demonstration. \"},\"cid\":\"c98\"}]}', '2015-03-22 19:14:29', 'enabled', 1);
INSERT INTO quotationforms (`quotationforms_id`, `quotationforms_title`, `quotationforms_code`, `quotationforms_date_created`, `quotationforms_status`, `quotations_created_by_id`) VALUES (3, 'VIDEO MARKETING QUESTIONNAIRE', '{\"fields\":[{\"label\":\"Business Name:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c2\"},{\"label\":\"Business Street Address:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(Make sure it is the same as your Google map listing\"},\"cid\":\"c6\"},{\"label\":\"City:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c10\"},{\"label\":\"State/Province:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c14\"},{\"label\":\"Postal/Zip Code:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c27\"},{\"label\":\"Country:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c32\"},{\"label\":\"Official Contact Person:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c37\"},{\"label\":\"Business Telephone Number:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c42\"},{\"label\":\"Website URL:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c78\"},{\"label\":\"Year Founded:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\"cid\":\"c56\"},{\"label\":\"Business Email:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(Please put the email address your business uses for all business-related correspondences like info@businessname.com.)\"},\"cid\":\"c61\"},{\"label\":\"Contact Name for Citations:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(This will be used to create accounts on various business directories such as Yelp, YP, etc. It could be owner\'s name, a manager, or an alias.)\"},\"cid\":\"c51\"},{\"label\":\"Citations Gmail and Password:\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(Please provide us with a new GMAIL account businessname2015@gmail.com that we can use to register/verify your business in various business directories. This GMAIL is going to receive a high volume of spam.)\\n\"},\"cid\":\"c18\"},{\"label\":\"Hours of Operation:\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(Please breakdown by week day Mon, Tues, Wed, Thurs, Fri, Sat, Sun and the hours open  if they vary throughout the week.) \"},\"cid\":\"c22\"},{\"label\":\"Business Listing Categories:\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(THIS IS OPTIONAL. If you choose to give this information then please provide us with as much business categories your business falls under  to ensure listing on all business directories. Ex: Hotel, Luxury Hotel, Boutique Hotel, etc. One per line.)\"},\"cid\":\"c45\"},{\"label\":\"Business Description:\",\"field_type\":\"paragraph\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"(THIS IS OPTIONAL. If you choose to provide this information then please put a paragraph or 2 that best describes your business and why potential customers/clients should choose you over your competition. Most clients usually take an existing description from their website, facebook or map listing about)\\n\"},\"cid\":\"c26\"},{\"label\":\"Name some PRODUCTS/SERVICES you sell/offer:\",\"field_type\":\"paragraph\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"(THIS IS OPTIONAL. If you choose to give this information then please provide us with as many as 10 of your most popular or best selling or expensive products/services. One per line.)\"},\"cid\":\"c50\"},{\"label\":\"Known Competitors:\",\"field_type\":\"paragraph\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"THIS IS OPTIONAL. If you choose to give this information then please provide us up to 10 competitors in the area, companies you want to compete against or companies on page one of search results for the keywords you wish to target. One per line.)\"},\"cid\":\"c60\"},{\"label\":\"Link to YouTube Channel or Existing Videos of Business:\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(THIS IS MANDATORY. Please provide us with a video of your business and/or products. This helps your business get found on Google. You may upload the video to Dropbox, Google Drive or any other other file sharing website and give us the link,  or simply send it to us as email attachment.\\n\\n If you have a video on your Google+ page or YouTube and you would like us to use it then simply let us know through this questionnaire. )\"},\"cid\":\"c65\"},{\"label\":\"Google+ URL:\",\"field_type\":\"text\",\"required\":false,\"field_options\":{\"size\":\"small\"},\"cid\":\"c94\"},{\"label\":\"Facebook Page Link:\",\"field_type\":\"text\",\"required\":false,\"field_options\":{\"size\":\"small\"},\"cid\":\"c98\"},{\"label\":\"Twitter Page Link:\",\"field_type\":\"text\",\"required\":false,\"field_options\":{\"size\":\"small\"},\"cid\":\"c104\"},{\"label\":\"Link to Existing Photos of Business:\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(THIS IS OPTIONAL. Please provide us with some images of your business and/or products. This helps your business get found on Google. You may upload the files to Dropbox, Google Drive or any other other file sharing website and give us the link,  or simply send them to us as email attachment.\\n\\nAlternatively, if you have images on your Google+ page and you would like us to use them then simply let us know through this questionnaire.)\\n\"},\"cid\":\"c89\"},{\"label\":\"Keywords/Keyword phrases:\",\"field_type\":\"paragraph\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"(THIS IS OPTIONAL. If you choose to provide this information then please write as many as 10 keywords relevant to your business. One per line.)\\nExamples:\\n1 - Luxury Hotels Downtown Toronto\\n2 - Best Mexican Restaurant\\n3 - Hamilton Hair Salons\\n4 - Vintage Wedding Dress Boutiques\\n5 - Best Restaurant on St-Denis\\n\\n=====================\\n\\nNOTE: Please add this email addresses to your YouTube Account as a MANAGER if you need us to fully optimize your YouTube account.\\n\\nteambuzzooka@gmail.com\\n\\nIf you need assistance in doing this then kindly give us a call or email us to schedule a short demonstration. \"},\"cid\":\"c84\"}]}', '2015-03-23 02:02:20', 'enabled', 1);
