{\"label\":\"Citations Gmail and Password:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(Please provide us with a new GMAIL account  - businessname2015@gmail.com, and the password that we can use to register/verify your business in various business directories. \\nThis GMAIL is going to receive a high volume of spam so don\'t use your email).\\n\"},\"cid\":\"c90\"},{\"label\":\"Hours of Operation:\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(Please breakdown week day hours Mon, Tues, Wed, Thurs, Fri, Sat, Sun, and if they vary throughout the week.) \"},\"cid\":\"c5\"},{\"label\":\"Business Listing Category\'s:\",\"field_type\":\"paragraph\",\"required\":false,\"field_options\":{\"size\":\"small\",\"description\":\"(Please provide us with as many as 5 business categories your business falls under  to ensure listing on all appropriate site sources. Ex: Hotel, Luxury Hotel, Boutique Hotel, Hotel Pool, etc.)\"},\"cid\":\"c34\"},{\"label\":\"Business Description:\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(Put 2 or 3 short punchy paragraphs that best describes your business and why potential customers/clients should choose you over your competition. The paragraph should start off with the main keyword you are targeting but only mention a few keywords and only once in the description.  Many clients usually take an existing description from their website, Facebook or map listing about)\"},\"cid\":\"c44\"},{\"label\":\"Name some PRODUCTS/SERVICES you sell/offer:\",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(Please provide us with as many as 10 of your most popular or best selling or expensive products/services.)\"},\"cid\":\"c39\"},{\"label\":\"Website URL:\",\"field_type\":\"text\",\"required\":true,\"field_options\":{\"size\":\"small\"},\