hoose from for you ranking campaign).\"},\"cid\":\"c84\"},{\"label\":\"Keyword Sentences or phrases: \",\"field_type\":\"paragraph\",\"required\":true,\"field_options\":{\"size\":\"small\",\"description\":\"(Write as many as 10 sentences that have  3 to 5 words per sentence/phrase as you wish.  Make sure the search keyword and area/street/neighbourhood is in the phrase/sentence).\\nExamples:\\n1 - Luxury Hotels Downtown Montreal\\n2 - Best Mexican Restaurant in Montreal\\n3 - Best Hair Salons Downtown Montreal\\n4 - Vintage Wedding Dress Boutiques\\n5 - Best Restaurant on St-Denis\"},\"cid\":\"c101\"}]}', '2015-03-23 02:30:11', 'enabled', 1);
