INSERT INTO settings_emailtemplates (`id`, `settings_id`, `title`, `subject`, `message`, `restore_subject`, `restore_message`, `variables`, `type`, `DELETE_POST_DEV`) VALUES (3, 'new_client_welcome_client', 'lang_new_client', 'Project Dashboard - Welcome ', '<div style=\"height:7px; background-color:#535353\">&nbsp;</div>\n\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">Welcome<br />\n[var.clients_company_name]</div>\n\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\"><span style=\"font-weight:bold;\">[var.client_users_full_name]</span><br />\n<br />\nYour company has just been added to our Project Management Dashboard.<br />\n<br />\nBelow are your primary users login details.<br />\n<br />\nRemember, you can easily add more users to your company account via the Dashboard.<br />\n&nbsp;\n<table cellpadding=\"8\" style=\"border: 1px solid #DDDDDD; border-collapse: collapse; border-spacing: 0;font-size:13px;\" width=\"100%\">\n <tbody>\n  <tr>\n   <td style=\"border: 1px solid #DDDDDD;\" width=\"150\">Username</td>\n   <td style=\"border: 1px solid #DDDDDD;\" width=\"276\">[var.client_users_email]</td>\n  </tr>\n  <tr>\n   <td style=\"border: 1px solid #DDDDDD;\">Password</td>\n   <td style=\"border: 1px solid #DDDDDD;\">[var.client_users_password]</td>\n  </tr>\n </tbody>\n</table>\n&nbsp;\n\n<div style=\" border:#CCCCCC solid 1px; padding:8px;\"><strong>Dashboard Link </strong><span style=\"font-size:14px;\"><a href=\"[var.client_dashboard_url]\">[var.client_dashboard_url]</a></span></div>\n<br />\n[var.company_email_signature]</div>\n</div>\n', 'Project Dashboard - Welcome ', '<div style=\"height:7px; background-color:#535353\">&nbsp;</div>\n\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">Welcome<br />\n[var.clients_company_name]</div>\n\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\"><span style=\"font-weight:bold;\">[var.client_users_full_name]</span><br />\n<br />\nYour company has just been added to our Project Management Dashboard.<br />\n<br />\nBelow are your primary users login details.<br />\n<br />\nRemember, you can easily add more users to your company account via the Dashboard.<br />\n&nbsp;\n<table cellpadding=\"8\" style=\"border: 1px solid #DDDDDD; border-collapse: collapse; border-spacing: 0;font-size:13px;\" width=\"100%\">\n	<tbody>\n		<tr>\n			<td style=\"border: 1px solid #DDDDDD;\" width=\"150\">Username</td>\n			<td style=\"border: 1px solid #DDDDDD;\" width=\"276\">[var.client_users_email]</td>\n		</tr>\n		<tr>\n			<td style=\"border: 1px solid #DDDDDD;\">Password</td>\n			<td style=\"border: 1px solid #DDDDDD;\">[var.client_users_password]</td>\n		</tr>\n	</tbody>\n</table>\n&nbsp;\n\n<div style=\" border:#CCCCCC solid 1px; padding:8px;\"><strong>Dashboard Link </strong><span style=\"font-size:14px;\"><a href=\"[var.client_dashboard_url]\">[var.client_dashboard_url]</a></span></div>\n\n<br />\n[var.company_email_signature]\n</div>\n</div>', '[var.clients_company_name], [var.client_users_full_name], [var.client_users_email], [var.client_users_password], [var.todays_date], [var.company_email_signature], [var.client_dashboard_url]', 'client', '');
INSERT INTO settings_emailtemplates (`id`, `settings_id`, `title`, `subject`, `message`, `restore_subject`, `restore_message`, `variables`, `type`, `DELETE_POST_DEV`) VALUES (4, 'new_invoice_client', 'lang_new_invoice', 'New Invoice', '<div style=\"height:7px; background-color:#535353\"></div>\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">INVOICE</div>\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\"><span class=\"style1\"><span style=\"font-weight:bold;\">[var.client_users_full_name]<br />\n</span></span><br /> \n  Please find attched your invoice. You can download the attachment and print it for your records.<br>\n  <br>\n  You can also log into the control panel and manage/pay the invoice.<br />\n  <br />\n  <div style=\" border:#CCCCCC solid 1px; padding:8px;\"><strong>Invoice Payment Link </strong><span style=\"font-size:14px;\"><a href=\"[var.client_dashboard_url]\">[var.client_dashboard_url]</a></span><br>\n    <br>\n  [var.invoice_standard_terms]</div>\n  <br>\n  Thank you for your prompt payment<br>\n  <br />\n[var.company_email_signature]\n</div>\n</div>', 'New Invoice', '<div style=\"height:7px; background-color:#535353\"></div>\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">INVOICE</div>\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\"><span class=\"style1\"><span style=\"font-weight:bold;\">[var.client_users_full_name]<br />\n</span></span><br /> \n  Please find attched your invoice. You can download the attachment and print it for your records.<br>\n  <br>\n  You can also log into the control panel and manage/pay the invoice.<br />\n  <br />\n  <div style=\" border:#CCCCCC solid 1px; padding:8px;\"><strong>Invoice Payment Link </strong><span style=\"font-size:14px;\"><a href=\"[var.client_dashboard_url]\">[var.client_dashboard_url]</a></span><br>\n    <br>\n  [var.invoice_standard_terms]</div>\n  <br>\n  Thank you for your prompt payment<br>\n  <br />\n[var.company_email_signature]\n</div>\n</div>', '[var.client_users_full_name],[var.company_name], [var.clients_company_name], [var.company_email_signature], [var.todays_date], [var.client_dashboard_url], [var.invoices_id]', 'client', '');
INSERT INTO settings_emailtemplates (`id`, `settings_id`, `title`, `subject`, `message`, `restore_subject`, `restore_message`, `variables`, `type`, `DELETE_POST_DEV`) VALUES (5, 'overdue_invoice_client', 'lang_overdue_invoice', 'Overdue Invoice', '<div style=\"height:7px; background-color:#535353\"></div>\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">OVERDUE INVOICE</div>\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\"><span class=\"style1\"><span style=\"font-weight:bold;\">[var.client_users_full_name]<br />\n</span></span><br /> \n  This is a notice that an invoice that was generated on<strong> [var.invoices_date] </strong>is now overdue<br />\n  <br />\n  Invoice Details:<br />\n  <br />\n  <table width=\"100%\" cellpadding=\"8\" style=\"border: 1px solid #DDDDDD; border-collapse: collapse; border-spacing: 0;font-size:13px;\">\n    <tr>\n      <td width=\"150\" style=\"border: 1px solid #DDDDDD;\">Invoice Date</td>\n<td width=\"276\" style=\"border: 1px solid #DDDDDD;\">[var.invoices_date]</td>\n    </tr>\n    <tr>\n      <td style=\"border: 1px solid #DDDDDD;\">Invoice Invoice Due Date</td>\n      <td style=\"border: 1px solid #DDDDDD;\">[var.invoices_due_date]</td>\n    </tr>\n    <tr>\n      <td bgcolor=\"#F5F5F5\" style=\"border: 1px solid #DDDDDD;\"><strong>Invoice Amount</strong></td>\n      <td bgcolor=\"#F5F5F5\" style=\"border: 1px solid #DDDDDD;\"><strong>[var.currency_symbol][var.invoices_amount]</strong></td>\n    </tr>\n  </table>\n  <br />\n  Please kindly make payment using the link below<br />\n  <br />\n  <div style=\" border:#CCCCCC solid 1px; padding:8px;\"><strong>Invoice Payment Link </strong><span style=\"font-size:14px;\"><a href=\"[var.invoice_payment_link]\">[var.invoice_payment_link]</a></span></div>\n<br />\n[var.company_email_signature]\n</div>\n</div>', 'Overdue Invoice', '<div style=\"height:7px; background-color:#535353\"></div>\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">OVERDUE INVOICE</div>\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\"><span class=\"style1\"><span style=\"font-weight:bold;\">[var.client_users_full_name]<br />\n</span></span><br /> \n  This is a notice that an invoice that was generated on<strong> [var.invoices_date] </strong>is now overdue<br />\n  <br />\n  Invoice Details:<br />\n  <br />\n  <table width=\"100%\" cellpadding=\"8\" style=\"border: 1px solid #DDDDDD; border-collapse: collapse; border-spacing: 0;font-size:13px;\">\n    <tr>\n      <td width=\"150\" style=\"border: 1px solid #DDDDDD;\">Invoice Date</td>\n<td width=\"276\" style=\"border: 1px solid #DDDDDD;\">[var.invoices_date]</td>\n    </tr>\n    <tr>\n      <td style=\"border: 1px solid #DDDDDD;\">Invoice Invoice Due Date</td>\n      <td style=\"border: 1px solid #DDDDDD;\">[var.invoices_due_date]</td>\n    </tr>\n    <tr>\n      <td bgcolor=\"#F5F5F5\" style=\"border: 1px solid #DDDDDD;\"><strong>Invoice Amount</strong></td>\n      <td bgcolor=\"#F5F5F5\" style=\"border: 1px solid #DDDDDD;\"><strong>[var.currency_symbol][var.invoices_amount]</strong></td>\n    </tr>\n  </table>\n  <br />\n  Please kindly make payment using the link below<br />\n  <br />\n  <div style=\" border:#CCCCCC solid 1px; padding:8px;\"><strong>Invoice Payment Link </strong><span style=\"font-size:14px;\"><a href=\"[var.invoice_payment_link]\">[var.invoice_payment_link]</a></span></div>\n<br />\n[var.company_email_signature]\n</div>\n</div>', '[var.client_users_full_name], [var.invoices_date], [var.invoices_due_date], [var.currency_symbol], [var.invoices_amount], [var.invoice_payment_link], [var.company_name], [var.clients_company_name], [var.company_email_signature], [var.todays_date], [var.client_dashboard_url], [var.project_link], [var.invoices_id]', 'client', '');
INSERT INTO settings_emailtemplates (`id`, `settings_id`, `title`, `subject`, `message`, `restore_subject`, `restore_message`, `variables`, `type`, `DELETE_POST_DEV`) VALUES (6, 'new_project_client', 'lang_new_project', 'New Project Created', '<div style=\"height:7px; background-color:#535353\">&nbsp;</div>\n\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\"><br />\nNEW PROJECT</div>\n\n<div style=\"text-align:center; font-size:24px; font-weight:bold; color:#535353;\">[var.projects_title]</div>\n\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\"><span class=\"style1\"><span style=\"font-weight:bold;\">[var.client_users_full_name]</span></span><br />\n<br />\nA new project has been added to your Project Dashboard.<br />\n&nbsp;\n<table cellpadding=\"8\" style=\"border: 1px solid #DDDDDD; border-collapse: collapse; border-spacing: 0;font-size:13px;\" width=\"100%\">\n <tbody>\n  <tr>\n   <td style=\"border: 1px solid #DDDDDD;\" width=\"150\">Project Title</td>\n   <td style=\"border: 1px solid #DDDDDD;\" width=\"276\">[var.projects_title]</td>\n  </tr>\n  <tr>\n   <td style=\"border: 1px solid #DDDDDD;\">Date Created</td>\n   <td style=\"border: 1px solid #DDDDDD;\">[var.projects_date_created]</td>\n  </tr>\n  <tr>\n   <td style=\"border: 1px solid #DDDDDD;\">Anticipated Completion Date</td>\n   <td style=\"border: 1px solid #DDDDDD;\">[var.project_deadline]</td>\n  </tr>\n  <tr>\n   <td bgcolor=\"#F5F5F5\" style=\"border: 1px solid #DDDDDD;\"><strong>Project ID</strong></td>\n   <td bgcolor=\"#F5F5F5\" style=\"border: 1px solid #DDDDDD;\"><strong>[var.projects_id]</strong></td>\n  </tr>\n </tbody>\n</table>\n<br />\nYou can login to the Project Dashboard to keep manage and keep track of this project<br />\n&nbsp;\n<div style=\" border:#CCCCCC solid 1px; padding:8px;\"><strong>Direct Link </strong><span style=\"font-size:14px;\"><a href=\"[var.str_project_link]\">[var.str_project_link]</a></span></div>\n<br />\n[var.company_email_signature]</div>\n</div>\n', 'New Project Created', '<div style=\"height:7px; background-color:#535353\"></div>\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">NEW PROJECT</div>\n<div style=\"text-align:center; font-size:24px; font-weight:bold; color:#535353;\">[var.projects_title]</div>\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\"><span class=\"style1\"><span style=\"font-weight:bold;\">[var.client_users_full_name]<br />\n</span></span><br /> \n  A new project has been added to your Project Dashboard.\n  <br />\n  <br />\n  <table width=\"100%\" cellpadding=\"8\" style=\"border: 1px solid #DDDDDD; border-collapse: collapse; border-spacing: 0;font-size:13px;\">\n    <tr>\n      <td width=\"150\" style=\"border: 1px solid #DDDDDD;\">Project Title</td>\n<td width=\"276\" style=\"border: 1px solid #DDDDDD;\">[var.projects_title]</td>\n    </tr>\n    <tr>\n      <td style=\"border: 1px solid #DDDDDD;\">Date Created</td>\n      <td style=\"border: 1px solid #DDDDDD;\">[var.projects_date_created]</td>\n    </tr>\n    <tr>\n      <td style=\"border: 1px solid #DDDDDD;\">Anticipated Completion Date</td>\n      <td style=\"border: 1px solid #DDDDDD;\">[var.project_deadline]</td>\n    </tr>\n    <tr>\n      <td bgcolor=\"#F5F5F5\" style=\"border: 1px solid #DDDDDD;\"><strong>Project ID</strong></td>\n      <td bgcolor=\"#F5F5F5\" style=\"border: 1px solid #DDDDDD;\"><strong>[var.projects_id]</strong></td>\n    </tr>\n  </table>\n  <br />\n  You can \n  login to the Project Dashboard to keep manage and keep track of this project<br />\n  <br />\n  <div style=\" border:#CCCCCC solid 1px; padding:8px;\"><strong> Direct Link </strong><span style=\"font-size:14px;\"><a href=\"[var.str_project_link]\">[var.str_project_link]</a></span></div>\n<br />\n[var.company_email_signature]\n</div>\n</div>', '[var.clients_company_name], [var.client_users_full_name], [var.todays_date], [var.company_email_signature], [var.client_dashboard_url], [var.projects_title], [var.projects_date_created], [var.project_deadline], [var.project_link]', 'client', '');
INSERT INTO settings_emailtemplates (`id`, `settings_id`, `title`, `subject`, `message`, `restore_subject`, `restore_message`, `variables`, `type`, `DELETE_POST_DEV`) VALUES (7, 'general_notification_client', 'lang_general_notification', 'Project Notification', '<div style=\"height:7px; background-color:#535353\"></div>\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">  [var.email_title]</div>\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\"><span style=\"font-weight:bold;\">[var.addressed_to]<br />\n</span><br /> \n  [var.email_message]<br />\n  <br />\n  <br>\n<div style=\" border:#CCCCCC solid 1px; padding:8px;\"><strong>Dashboard Link </strong><span style=\"font-size:14px;\"><a href=\"[var.client_dashboard_url]\">[var.client_dashboard_url]</a></span></div>\n<br />\n[var.company_email_signature]\n</div>\n</div>', 'Project Notification', '<div style=\"height:7px; background-color:#535353\"></div>\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">  [var.email_title]</div>\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\"><span style=\"font-weight:bold;\">[var.addressed_to]<br />\n</span><br /> \n  [var.email_message]<br />\n  <br />\n  <br>\n<div style=\" border:#CCCCCC solid 1px; padding:8px;\"><strong>Dashboard Link </strong><span style=\"font-size:14px;\"><a href=\"[var.client_dashboard_url]\">[var.client_dashboard_url]</a></span></div>\n<br />\n[var.company_email_signature]\n</div>\n</div>', '[var.company_email_signature], [var.todays_date], [var.client_dashboard_url], [var.notification_message]', 'client', 'completed & tested');
