INSERT INTO settings_emailtemplates (`id`, `settings_id`, `title`, `subject`, `message`, `restore_subject`, `restore_message`, `variables`, `type`, `DELETE_POST_DEV`) VALUES (18, 'password_reset_admin', 'lang_reset_password', 'Reset Password', '<div style=\"height:7px; background-color:#535353\"></div>\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">Password Reset</div>\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\"><span class=\"style1\"><span style=\"font-weight:bold;\">[var.team_profile_full_name]<br />\n</span></span><br /> \n  You have requeste to reset your password. You can reset you password using the link below.<br />\n  <br />\n  This link will expire after <strong>30 Minutes</strong>.<br />\n  <br />\n  If you have not requested this email please notify us.<br />\n<br>\n<div style=\" border:#CCCCCC solid 1px; padding:8px;\"><strong>Password reset link: </strong><span style=\"font-size:14px;\"><a href=\"[var.password_reset_link]\">[var.password_reset_link]</a>\n</div><br />\n    [var.company_email_signature]\n</div></div>', 'Reset Password', '<div style=\"height:7px; background-color:#535353\"></div>\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">Password Reset</div>\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\"><span class=\"style1\"><span style=\"font-weight:bold;\">[var.team_profile_full_name]<br />\n</span></span><br /> \n  You have requeste to reset your password. You can reset you password using the link below.<br />\n  <br />\n  This link will expire after <strong>30 Minutes</strong>.<br />\n  <br />\n  If you have not requested this email please notify us.<br />\n<br>\n<div style=\" border:#CCCCCC solid 1px; padding:8px;\"><strong>Password reset link: </strong><span style=\"font-size:14px;\"><a href=\"[var.password_reset_link]\">[var.password_reset_link]</a>\n</div><br />\n    [var.company_email_signature]\n</div></div>', '[var.password_reset_link], [var.team_profile_full_name], [var.company_email_signature], [var.str_todays_date], [var.str_client_dashboard_url]', 'admin', '');
INSERT INTO settings_emailtemplates (`id`, `settings_id`, `title`, `subject`, `message`, `restore_subject`, `restore_message`, `variables`, `type`, `DELETE_POST_DEV`) VALUES (19, 'new_quotation_client', 'lang_new_quotation', 'Your Quotation Request', '<div style=\"height:7px; background-color:#535353\">&nbsp;</div>\n\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">QUOTATION</div>\n\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\"><strong>[var.client_users_full_name]</strong><br />\n<br />\nThank you for you for filling in our Quotation Request Form.<br />\n<br />\nPlease find below are our quotation:<br />\n&nbsp;\n<table cellpadding=\"8\" style=\"border: 1px solid #DDDDDD; border-collapse: collapse; border-spacing: 0;font-size:13px;\" width=\"100%\">\n <tbody>\n  <tr>\n   <td style=\"border: 1px solid #DDDDDD;\" width=\"150\">Quotation Date</td>\n   <td style=\"border: 1px solid #DDDDDD;\" width=\"276\">[var.todays_date]</td>\n  </tr>\n  <tr>\n   <td style=\"border: 1px solid #DDDDDD;\">Our Quotation</td>\n   <td style=\"border: 1px solid #DDDDDD;\"><strong>[var.currency_symbol][var.quotation_amount]</strong></td>\n  </tr>\n  <tr>\n   <td bgcolor=\"#F5F5F5\" style=\"border: 1px solid #DDDDDD;\">Addtitional Comments</td>\n   <td bgcolor=\"#F5F5F5\" style=\"border: 1px solid #DDDDDD;\">[var.quotation_notes]</td>\n  </tr>\n </tbody>\n</table>\n<br />\nThank you and we look forward to working with you.<br />\n<br />\n[var.company_email_signature]</div>\n</div>', 'Your Quotation Request', '<div style=\"height:7px; background-color:#535353\">&nbsp;</div>\n\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">QUOTATION</div>\n\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\"><strong>[var.client_users_full_name]</strong><br />\n<br />\nThank you for you for filling in our Quotation Request Form.<br />\n<br />\nPlease find below are our quotation:<br />\n&nbsp;\n<table cellpadding=\"8\" style=\"border: 1px solid #DDDDDD; border-collapse: collapse; border-spacing: 0;font-size:13px;\" width=\"100%\">\n <tbody>\n  <tr>\n   <td style=\"border: 1px solid #DDDDDD;\" width=\"150\">Quotation Date</td>\n   <td style=\"border: 1px solid #DDDDDD;\" width=\"276\">[var.todays_date]</td>\n  </tr>\n  <tr>\n   <td style=\"border: 1px solid #DDDDDD;\">Our Quotation</td>\n   <td style=\"border: 1px solid #DDDDDD;\"><strong>[var.currency_symbol][var.quotation_amount]</strong></td>\n  </tr>\n  <tr>\n   <td bgcolor=\"#F5F5F5\" style=\"border: 1px solid #DDDDDD;\">Addtitional Comments</td>\n   <td bgcolor=\"#F5F5F5\" style=\"border: 1px solid #DDDDDD;\">[var.quotation_notes]</td>\n  </tr>\n </tbody>\n</table>\n<br />\nThank you and we look forward to working with you.<br />\n<br />\n[var.company_email_signature]</div>\n</div>', '[var.client_users_full_name],[var.currency_symbol], [var.quotation_amount], [var.quotation_notes],[var.company_email_signature], [var.todays_date], [var.client_dashboard_url]', 'client', 'completed & tested');
INSERT INTO settings_emailtemplates (`id`, `settings_id`, `title`, `subject`, `message`, `restore_subject`, `restore_message`, `variables`, `type`, `DELETE_POST_DEV`) VALUES (20, 'new_payment_admin', 'lang_new_payment', 'New Payment Received', '<div style=\"height:7px; background-color:#535353\">&nbsp;</div>\n\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">New Payment</div>\n\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\">Hello,<br />\n<br />\nA new payment has been made.<br />\n&nbsp;\n<table cellpadding=\"8\" style=\"border: 1px solid #DDDDDD; border-collapse: collapse; border-spacing: 0;font-size:13px;\" width=\"100%\">\n <tbody>\n  <tr>\n   <td style=\"border: 1px solid #DDDDDD;\" width=\"150\">Client Name</td>\n   <td style=\"border: 1px solid #DDDDDD;\" width=\"276\">[var.clients_company_name]</td>\n  </tr>\n  <tr>\n    <td style=\"border: 1px solid #DDDDDD;\">Invoice ID</td>\n    <td style=\"border: 1px solid #DDDDDD;\">[var.invoice_id]</td>\n  </tr>\n  <tr>\n    <td style=\"border: 1px solid #DDDDDD;\">Transaction ID</td>\n    <td style=\"border: 1px solid #DDDDDD;\">[var.transaction_id]</td>\n  </tr>\n  <tr>\n   <td style=\"border: 1px solid #DDDDDD;\">Amount</td>\n   <td style=\"border: 1px solid #DDDDDD;\">[var.amount]</td>\n  </tr>\n  <tr>\n    <td style=\"border: 1px solid #DDDDDD;\">Currency</td>\n    <td style=\"border: 1px solid #DDDDDD;\">[var.currency]</td>\n  </tr>\n </tbody>\n</table>\n</div>\n</div>', 'New Payment Received', '<div style=\"height:7px; background-color:#535353\">&nbsp;</div>\n\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n<div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">New Payment</div>\n\n<div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\">Hello,<br />\n<br />\nA new payment has been made.<br />\n&nbsp;\n<table cellpadding=\"8\" style=\"border: 1px solid #DDDDDD; border-collapse: collapse; border-spacing: 0;font-size:13px;\" width=\"100%\">\n <tbody>\n  <tr>\n   <td style=\"border: 1px solid #DDDDDD;\" width=\"150\">Client Name</td>\n   <td style=\"border: 1px solid #DDDDDD;\" width=\"276\">[var.clients_company_name]</td>\n  </tr>\n  <tr>\n    <td style=\"border: 1px solid #DDDDDD;\">Invoice ID</td>\n    <td style=\"border: 1px solid #DDDDDD;\">[var.invoice_id]</td>\n  </tr>\n  <tr>\n    <td style=\"border: 1px solid #DDDDDD;\">Transaction ID</td>\n    <td style=\"border: 1px solid #DDDDDD;\">[var.transaction_id]</td>\n  </tr>\n  <tr>\n   <td style=\"border: 1px solid #DDDDDD;\">Amount</td>\n   <td style=\"border: 1px solid #DDDDDD;\">[var.amount]</td>\n  </tr>\n  <tr>\n    <td style=\"border: 1px solid #DDDDDD;\">Currency</td>\n    <td style=\"border: 1px solid #DDDDDD;\">[var.currency]</td>\n  </tr>\n </tbody>\n</table>\n</div>\n</div>', '[var.clients_company_name], [var.invoice_id], [var.transaction_id], [var.amount], [var.currency]', 'admin', '');
INSERT INTO settings_emailtemplates (`id`, `settings_id`, `title`, `subject`, `message`, `restore_subject`, `restore_message`, `variables`, `type`, `DELETE_POST_DEV`) VALUES (22, 'new_team_member', 'lang_new_team_member', 'Your Dashboard Account Details', '<div style=\"height:7px; background-color:#535353\"></div>\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n  <div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">Welcome<br>\n  - account details -</div>\n  <div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\">[var.team_profile_full_name]<br />\n    <br />\n    Below are your new Dashboard login details<br />\n    <br>\n    <table width=\"100%\" cellpadding=\"8\" style=\"border: 1px solid #DDDDDD; border-collapse: collapse; border-spacing: 0;font-size:13px;\">\n      <tr>\n        <td style=\"border: 1px solid #DDDDDD;\">Username</td>\n        <td style=\"border: 1px solid #DDDDDD;\">[var.team_profile_email]</td>\n      </tr>\n      <tr>\n        <td width=\"150\" style=\"border: 1px solid #DDDDDD;\">Password</td>\n        <td width=\"276\" style=\"border: 1px solid #DDDDDD;\">[var.team_profile_password]</td>\n      </tr>\n    </table>\n    <br>\n    <div style=\" border:#CCCCCC solid 1px; padding:8px;\"><strong>Dashboard Link </strong><span style=\"font-size:14px;\"><a href=\"[var.admin_dashboard_url]\">[var.admin_dashboard_url]</a> </div>\n  </div>\n</div>', 'Your Dashboard Account Details', '<div style=\"height:7px; background-color:#535353\"></div>\n<div style=\"background-color:#f5f5f5; margin:0px; padding:55px 20px 40px 20px; font-family:Helvetica, sans-serif; font-size:13px; color:#535353;\">\n  <div style=\"text-align:center; font-size:34px; font-weight:bold; color:#535353;\">Welcome<br>\n  - account details -</div>\n  <div style=\"border-radius: 5px 5px 5px 5px; padding:20px; margin-top:45px; background-color:#FFFFFF; font-family:Arial, Helvetica, sans-serif; font-size:13px;\">[var.team_profile_full_name]<br />\n    <br />\n    Below are your new Dashboard login details<br />\n    <br>\n    <table width=\"100%\" cellpadding=\"8\" style=\"border: 1px solid #DDDDDD; border-collapse: collapse; border-spacing: 0;font-size:13px;\">\n      <tr>\n        <td style=\"border: 1px solid #DDDDDD;\">Username</td>\n        <td style=\"border: 1px solid #DDDDDD;\">[var.team_profile_email]</td>\n      </tr>\n      <tr>\n        <td width=\"150\" style=\"border: 1px solid #DDDDDD;\">Password</td>\n        <td width=\"276\" style=\"border: 1px solid #DDDDDD;\">[var.team_profile_password]</td>\n      </tr>\n    </table>\n    <br>\n    <div style=\" border:#CCCCCC solid 1px; padding:8px;\"><strong>Dashboard Link </strong><span style=\"font-size:14px;\"><a href=\"[var.admin_dashboard_url]\">[var.admin_dashboard_url]</a> </div>\n  </div>\n</div>', '[var.team_profile_full_name], [var.team_profile_email],  [var.team_profile_password], [var.company_email_signature], [var.str_todays_date], [var.admin_dashboard_url]', 'admin', 'completed & tested');
